import React, { Component } from 'react'

export default class Button extends Component {
  state = {
    clicked:false
  };
  butStyle = {
    fontWeight:0,
    fontFamily:"Comic Sans",
    display:"length",
    verticalAlign:"bottom",
    color:"red"
    
  };
  bodyStyle = {
    textAlign:"center",
    backgroundColor:"Black"
  };
  render() {
    return (
      <div style={this.bodyStyle}>
        <button style={this.butStyle}>Official Fantasy Rules</button>
        <span></span>
        <button style={this.butStyle}>Custom Fantasy Rules</button>
      </div>
    )
  }
}
